import {Link} from 'react-router-dom';

function matchSmallComponent(props) {

  if(!props.match){return null} // important

    return (
      <div className="matchSmallComponent">

        <h3><Link to = {`/team/${props.match.team1}`}>{props.match.team1} </Link> 
        VS 
        <Link to = {`/team/${props.match.team2}`}> {props.match.team2}</Link></h3>

        <p>Winner: {props.match.winningTeam}</p>
        <p>Date: {props.match.date}</p>

      </div>
    );
  }

  export default matchSmallComponent;
